(33, 1, 1, 1, 7, 30, 1645765089, 1, '2022-01-26 16:17:57', '2022-03-25 04:58:09', NULL, 'Microsoft Xbox Series X 1TB SSD', '600.00', NULL, NULL, NULL, '15149225392', 'worldwide', 'bekasi west java indonesia', NULL, NULL, NULL, '<div>Microsoft Xbox Series X 1TB SSD Video Game Gaming Console + 1 Xbox Wireless Controller - 8X Cores Custom Zen 2 CPU, 16GB GDDR6 RAM, Ultra HD Blu-ray, True 4K, Up to 8K HDR, 120 FPS - HDMI Cable</div><div>Brand: Microsoft</div><div>&nbsp;4.0 out of 5 stars&nbsp; &nbsp; 1 rating</div><div>Platform<span style=\"white-space:pre\">	</span>Xbox</div><div>Brand<span style=\"white-space:pre\">	</span>Microsoft</div><div>Series<span style=\"white-space:pre\">	</span>Series</div><div>Connectivity technology<span style=\"white-space:pre\">	</span>HDMI</div><div>Memory storage capacity<span style=\"white-space:pre\">	</span>16 GB</div><div>About this item</div><div>What\'s in the box: Microsoft Xbox Series X Gaming Console; 1 Xbox Wireless Controller; Ultra High-Speed HDMI Cable; Power Cord.</div><div>The Xbox Series X provides a true 4K gaming experience, thanks to the 12 teraflops of processing power. Equipped with AMD\'s Zen 2 and RDNA 2 architectures, hardware-accelerated DirectX raytracing delivers realistic lighting, shadows, and reflections to create dynamic, living worlds.</div><div>Memory: 16GB GDDR6 w/320 bit-wide bus; Memory Bandwidth: 10 GB @ 560 GB/s, 6 GB @ 336 GB/s; Internal Storage: 1TB Custom NVME SSD</div><div>The Xbox Series X supports 3D Spatial Sound, which uses advanced algorithms to create immersive worlds that put you at the center of your experience. Games featuring the Optimized for Xbox Series X icon will showcase fast load times, heightened visuals, and steady frame rates, up to 120 fps.</div><div>Bundled with Ultra High Speed HDMI Cable</div>', NULL, NULL, NULL, '2022-01-26 21:17:57', '2022-02-25 09:58:09'),
(34, 1, 1, 1, 7, 30, 1645765089, 1, '2022-01-26 23:59:26', '2022-03-25 04:58:09', NULL, 'Nintendo Switch', '200.00', NULL, NULL, NULL, '15149225392', 'worldwide', 'montreal quebec canada', NULL, NULL, NULL, '<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"box-sizing: border-box; padding: 0px; margin-top: 0px; margin-right: 0px; margin-left: 0px; text-rendering: optimizelegibility; line-height: 32px !important; margin-bottom: 0px !important;\"><font color=\"#0f1111\" face=\"Amazon Ember, Arial, sans-serif\"><span style=\"font-size: 24px; letter-spacing: normal;\">Nintendo Switch with Neon Blue and Neon Red Joy‑Con™</span></font><br></h1><div><font color=\"#0f1111\" face=\"Amazon Ember, Arial, sans-serif\"><span style=\"font-size: 24px;\"><br></span></font></div><div><font color=\"#0f1111\" face=\"Amazon Ember, Arial, sans-serif\"><div><span style=\"font-size: 24px;\">The Nintendo Switch combines the mobility of a handheld with the power of a home gaming system, offering unprecedented gaming and entertainment experiences</span></div><div><span style=\"font-size: 24px;\">The Nintendo Switch and Dock connects the system to the TV and lets you play with your family and friends in the comfort of your living room</span></div><div><span style=\"font-size: 24px;\">With a bright, high-definition display Nintendo Switch lets you bring your at-home gaming experience with you anywhere; to the Park, on an airplane, in a car -- anywhere</span></div><div><span style=\"font-size: 24px;\">Attach the Joy-Con controllers to either side of Nintendo Switch for solo gaming on the go or detach them from Switch and use a Joy-Con controller in each hand</span></div><div><span style=\"font-size: 24px;\">With multiple Joy-Con controllers from a number of systems (each sold separately), numerous people can gather for a variety of gameplay options</span></div></font></div>', NULL, NULL, NULL, '2022-01-27 04:59:26', '2022-02-25 09:58:09'),
